import React from 'react'
import ProductCard from './ProductCard'

export default function ProductList(props) {
  console.log('logo', props.logo)
  return (
    <div>
      <h1>PRODUCT LIST</h1>
      <ProductCard logo={props.logo} title={props.title} price={props.price} />
    </div>
  )
}
